	[JsonSupportBehavior]
	public class TestDSDynamicContentService : DSDynamicContentService
	{
		protected override EFDynamicContentRepository CreateRepository()
		{
			return new EFDynamicContentRepository("DynamicContentTest", new DynamicContentEntityFactory());
		}
	}

	[Variant(RepositoryProvider.EntityFramework)]
    [Variant(RepositoryProvider.DataService)]
	public class DynamicContentScenarios : FunctionalTestBase, IDisposable
    {
		private TestDataService _service;

        #region Infrastructure/setup

        private readonly string _databaseName;
        private readonly object _previousDataDirectory;

		public DynamicContentScenarios()
        {
            _previousDataDirectory = AppDomain.CurrentDomain.GetData("DataDirectory");
            AppDomain.CurrentDomain.SetData("DataDirectory", TempPath);
            _databaseName = "DynamicContentTest";
			
        }

        public override void Init(RepositoryProvider provider)
        {
            if (provider == RepositoryProvider.DataService)
            {
                _service = new TestDataService(typeof(TestDSDynamicContentService));
            }

            base.Init(provider);
        }

		public void Dispose()
		{
			try
			{
				// Ensure LocalDb databases are deleted after use so that LocalDb doesn't throw if
				// the temp location in which they are stored is later cleaned.
				using (var context = new EFDynamicContentRepository(_databaseName))
				{
					context.Database.Delete();
				}

                if (_service != null)
                {
                    _service.Dispose();
                }

			}
			finally
			{
				AppDomain.CurrentDomain.SetData("DataDirectory", _previousDataDirectory);
			}
		}
		#endregion

		[RepositoryTheory]
		public void Can_save_content_publishing_with_5_conditions_in_ExpressionBuilder()
		{
			var client = GetRepository();

			var groupId = Guid.NewGuid().ToString();
			var dbReviewreview = new DynamicContentPublishingGroup
				{
				DynamicContentPublishingGroupId = groupId,
				Name = "Test content publishing", 
				Description = "Test content publishing description", 
				IsActive = true, 
				Priority = 1,
			};

			client.Add(dbReviewreview);
			client.UnitOfWork.Commit();

			//RefreshClient
			RefreshRepository(ref client);

			var loadedContentPublishing = client.PublishingGroups.Where(r => r.DynamicContentPublishingGroupId == groupId).SingleOrDefault();
			Assert.Equal(groupId, loadedContentPublishing.DynamicContentPublishingGroupId);

			//aa: add conditions expression and predicate tree serialized of 5 conditions.
			loadedContentPublishing.ConditionExpression = ConditionExpression;
			loadedContentPublishing.PredicateVisualTreeSerialized = PredicateSerialized;
			
			client.UnitOfWork.Commit();

			//RefreshClient
			RefreshRepository(ref client);
			loadedContentPublishing = client.PublishingGroups.Where(r => r.DynamicContentPublishingGroupId == groupId).SingleOrDefault();
		}

		private IDynamicContentRepository GetRepository()
		{
			EnsureDatabaseInitialized(() => new EFDynamicContentRepository(_databaseName), () => Database.SetInitializer(new SetupMigrateDatabaseToLatestVersion<EFDynamicContentRepository, Configuration>()));

			if (RepositoryProvider == RepositoryProvider.DataService)
			{
				return new DSDynamicContentClient(_service.ServiceUri, new DynamicContentEntityFactory(), null);
			}
			else
			{
				return new EFDynamicContentRepository(_databaseName);
			}
		}

		private void RefreshRepository(ref IDynamicContentRepository client)
		{
			client.Dispose();
			client = null;
			GC.Collect();
			client = GetRepository();
		}

